class GitIntegrationPlugin {
  constructor() {
    this.hooks = {
      'terminal-created': this.onTerminalCreated.bind(this),
      'directory-changed': this.onDirectoryChanged.bind(this),
    };
  }

  async onTerminalCreated(terminalData) {
