        'npm install',
        'npm start',
        'npm run build',
        'npm test',
        'npm run dev',
        'npm update',
        'npm audit'
      );
    } else if (input.includes('docker')) {
      suggestions.push(
        'docker ps',
        'docker images',
        'docker build .',
        'docker run',
        'docker exec',
        'docker logs',
        'docker stop'
      );
    } else if (input.includes('kubectl')) {
