      const status = licenseManager.getStatus();

      let statusText = '';
      let statusColor = '';

      switch (status.tier) {
      case 'trial':
        statusText = `≡ƒöæ Trial (${status.trialDaysRemaining} days)`;
        statusColor = '#ffd93d';
        break;
      case 'personal':
        statusText = '≡ƒæñ Personal';
        statusColor = '#51cf66';
        break;
      case 'professional':
        statusText = '≡ƒÆ╝ Professional';
        statusColor = '#74c0fc';
        break;
      case 'team':
        statusText = '≡ƒæÑ Team';
        statusColor = '#9775fa';
        break;
      case 'enterprise':
        statusText = '≡ƒÅó Enterprise';
        statusColor = '#ff8c42';
        break;
      case 'expired':
        statusText = 'Γ¥î Expired';
        statusColor = '#f92672';
        break;
      default:
        statusText = 'Γ¥ô Unknown';
        statusColor = '#666';
      }

      licenseElement.textContent = statusText;
      licenseElement.style.color = statusColor;

      // Make it clickable to show upgrade options
      licenseElement.style.cursor = 'pointer';
      licenseElement.onclick = () => this.showLicenseManager();
    }
  }

  showLicenseManager() {
    const status = licenseManager.getStatus();

    const licenseModal = this.pluginAPI.createModal(
      '≡ƒöæ License Manager',
      `
            <div class="license-manager">
                <div class="license-status-section">
                    <h4>Current License Status</h4>
                    <div class="current-license">
                        <div class="license-tier">${status.tier.toUpperCase()}</div>
                        <div class="license-details">
